public FigCompartment(
        final CompartmentConstructorParameters params,
        final List<Object> metaTypes
    ) {

        super(params.getOwner(), params.getSettings());

        Model.getFacade().getModelElementContents(params.getOwner());
        for (Object element
                : Model.getFacade().getModelElementContents(params.getOwner())) {
            if (metaTypes.contains(element.getClass())) {
                try {
                    int y = params.getBounds().y + getTopMargin();
                    int x = params.getBounds().x + getLeftMargin();
                    Rectangle childBounds = new Rectangle(x, y, 0, 0);
                    FigNotation fn = new FigNotation(
                            element, childBounds, params.getSettings(), NotationType.NAME);
                    addFig(fn);
                    y += fn.getHeight();
                } catch (InvalidElementException e) {
                }
            }
        }

        Model.getPump().addModelEventListener(
                (AssociationChangeListener) this, params.getOwner(), params.getPropertyName());
        // TODO: Remove listeners for add/remove events
    }

