        this.owner = owner;
        this.bounds = bounds;
        this.settings = settings;
        this.metaType = metaType;
        this.propertyName = propertyName;
    }

    public Object getOwner() {
        return owner;
    }

    public Rectangle getBounds() {
        return bounds;
    }

    public DiagramSettings getSettings() {
        return settings;
